webpackJsonp([0xf5a6de09f1f6],{867:function(e,t){e.exports={data:{wordpressPost:{title:"Special offer for Second Global Symposium on Health Services Research authors",content:'<p>&nbsp;</p>\n<p>The <a href="http://www.hsr-symposium.org/" target="_blank">Second Global Symposium on Health Services Research </a>will take place in Beijing in October/November 2012.</p>\n<p>We are delighted to announce that if you are a researcher whose work has been accepted for presentation at the symposium then you can receive a 25% discount on article-processing charges if you submit your manuscript to BMJ Open before 6 July 2012.</p>\n<p>Just mention in your covering letter that your work has been accepted for presentation at the symposium and include the acceptance letter as a supplementary file.</p>\n<p>Acceptance by BMJ Open will still be subject to satisfactory peer review. Full fee waivers remain available to authors where needed.<!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"af31767d-9326-516e-8814-f3f4e2272988"}}}});
